import React from 'react';
import Layout from '../../layout/Layout';
import { Button, Table } from 'react-bootstrap';
const User = () => {
  return (
    <>
      <Layout>
        <Button> AddUser</Button>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>#</th>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Username</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>1</td>
              <td>Mark</td>
              <td>Otto</td>
              <td>@mdo</td>
            </tr>
          </tbody>
        </Table>
      </Layout>
    </>
  );
};
export default User;
